import React from 'react'
import { Box, Typography } from '@mui/material'

const WorkoutLog = () => {
    return (
        <Box sx={{
            height: '40px',
            margin: '10px',
            backgroundColor: 'white',
            border: '1px solid black',
            display: 'flex',
            flexDirection: 'column',
            justifyContent: 'center'
        }}>
            <Typography>Date:</Typography>
        </Box>
    )
}

export default WorkoutLog
